                  <h1 className="text-center">Welcome!</h1>
              </div>
          </header>
          <div className="container-md row">
              <div className="row">
                  <button >Create a Voucher</button>
              </div>
              <div className="row">
                  <button >Reedem a Voucher</button>
              </div>
          </div>

      </div>
  );
}

export default App;
